import React from 'react';
import './App.css';
import Navigation from './Components/Navigation';
import About from './Components/About';
import Resume from './Components/Resume';

function App() {
  return (
    <React.Fragment>
    <div className='wrapper'>
      <Navigation />
      <About />
      <Resume />
    </div>
    </React.Fragment>
  );
}

export default App;
